const userDetails = [
  { key: "name", title: "Name", dataIndex: "name" },
  { key: "age", title: "Age", dataIndex: "age" },
  { key: "phone", title: "Phone Number", dataIndex: "phone" },
  { key: "bloodGroup", title: "Blood Group", dataIndex: "bloodGroup" },
  { key: "company", title: "Company", dataIndex: "company" },
  { key: "position", title: "Position", dataIndex: "position" },
  { key: "weight", title: "Weight", dataIndex: "weight" },
];

export { userDetails };
